import logo from './logo.svg';
import './App.css';

const user = {
  name: 'Hhii',
  imageUrl: 'https://i.imgur.comewsd/yXOvdOSs.jpg',
  imageSize: 500,
};

export default function Profile() {
  return (
    <>
      <h1>hello{user.name}</h1>
      <img
        className="avatar"
        src={user.imageUrl}
        alt={'Photo of ' + user.name}
        style={{
          width: user.imageSize,
          height: user.imageSize
        }}
      />
    </>
  );
}
